import logo from './logo.svg';
import './App.css';

function akash() {
  return (
    <div>
    <Route path="/about">
      <About />
    </Route>
    <Route path="/:user">
      <User />
    </Route>
    <Route>
      <NoMatch />
    </Route>
  </div>
  );
}

export default akash;
